import React, {Component} from 'react';
import {Button} from 'react-mdl';
import "../../node_modules/bootstrap/dist/css/bootstrap.css";
import "../../node_modules/animate.css";
import './App.css';

class LandingPage extends Component{
    render(){
        return( 
            
            <section className="landing-grid" style={{width: '100%', margin:'auto'}}>
                
               <div className=" flex1"> 
               <h6 className="animate__animated animate__flash animate__repeat-3 animate__slow">Hi!</h6>
                <h1 className="animate__animated animate__bounce animate__repeat-3 animate__slow">I Will Dseign for you a<span className="texts animate__animated animate__pulse animate__repeat-3 animate__slow"><br></br> Responsive website</span></h1>
                </div>
                
                <div className="flex2">
                <img src={process.env.PUBLIC_URL+"awaispic.jpg"} alt="my-pic"
                className="rounded-circle"/>
         </div>
                 <div className="flex3">
                 <Button raised accent ripple className="btton">Higher me!</Button>
                 </div>
                
            </section>
            
           
        )
    }
}
export default LandingPage;
